import React from 'react';

const ProductCard = ({ onAddToCart }) => {
    const product = { id: 1, name: 'Product 1' }; // Пример товара

    return (
        <div>
            <h3>{product.name}</h3>
            <button onClick={() => onAddToCart(product)}>Добавить в корзину</button>
        </div>
    );
};

export default ProductCard;
